function TopDrinks({ data, nutrient, onDrinkSelect }) {
    const topItems = [...data]
        .sort((a, b) => b[nutrient] - a[nutrient])
        .slice(0, 5);

    return (
        <div className="top-drinks">
            <h2>Top Drinks by {nutrient}</h2>
            <div className="drink-cards">
                {topItems.map(drink => (
                    <div key={drink.name} className="drink-card" onClick={() => onDrinkSelect(drink.name)}>
                        {drink.name}
                    </div>
                ))}
            </div>
        </div>
    );
}


export default TopDrinks;
